			using System;
using System.Linq;
using Skyline.DataMiner.Scripting;

/// <summary>
/// DataMiner QAction Class: OnGenericTableActions.
/// </summary>
public static class QAction
{
	#region Public methods
	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	/// <param name="extraData">Context menu parameter data.</param>
	public static void Run(SLProtocolExt protocol, object extraData)
	{
		try
		{
			var sa = extraData as string[];
			if (sa == null || sa.Length < 2)
				return;

			switch (sa[1])
			{
				case "Add":
					AddRow(protocol, sa);
					break;
				case "Delete":
					DeleteRows(protocol, sa.Skip(2).ToArray());
					break;
				default:
					protocol.Log(
						string.Format(">>>QA{0} Unknown action {1}", protocol.QActionID, sa[1]),
						LogType.Allways,
						LogLevel.LogEverything);
					break;
			}
		}
		catch (Exception ex)
		{
			protocol.Log(
				"QA" +
					protocol.QActionID +
					"|" +
					protocol.GetTriggerParameter() +
					"|Run|Exception thrown:" +
					Environment.NewLine +
					ex,
				LogType.Error,
				LogLevel.NoLogging);
		}
	}
	#endregion

	#region Private methods
	private static void AddRow(SLProtocolExt protocol, string[] sa)
	{
		object[] row = new object[]
		{
			Guid.NewGuid().ToString(),
			sa[2],
			sa[3],
			Convert.ToDouble(sa[4]),
			DateTime.Now.ToOADate(),
			Convert.ToDouble(sa[5]),
			0,
		};
		protocol.AddRow(Parameter.Generictable.tablePid, row);
	}

	private static void DeleteRows(SLProtocolExt protocol, string[] ids)
	{
		foreach (string id in ids)
		{
			protocol.DeleteRow(Parameter.Generictable.tablePid, id);
		}
	}
	#endregion
}

