/// <summary>
/// DataMiner QAction Class: Generic Input Mux Table - ContextMenu.
/// </summary>
public static class QAction
{
    /// <summary>
    /// The QAction entry point.
    /// </summary>
    /// <param name="protocol">Link with SLProtocol process.</param>
    /// <param name="contextMenuData"><see cref="object"/> containing the table ContextMenu data.</param>
    public static void Run(SLProtocolExt protocol, object contextMenuData)
    {
        try
        {
            ContextMenuGenericInputMuxTable contextMenu = new ContextMenuGenericInputMuxTable(
                protocol,
                contextMenuData,
                3000);
            contextMenu.ProcessContextMenuAction();
        }
        catch (Exception ex)
        {
            protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
        }
    }
}
