namespace QAction_3100
{
    using System;
    using Skyline.DataMiner.Scripting;
    using Skyline.DataMiner.Utils.Table.ContextMenu;

    internal enum Action
	{
		Additem = 0,
		DeleteItem = 1,
	}

    internal class ContextMenuGenericInputMuxTable : ContextMenu<Action>
	{
		public ContextMenuGenericInputMuxTable(SLProtocol protocol, object contextMenuData, int tablePid) : base(
			protocol,
			contextMenuData,
			tablePid)
		{
		}

		public override void ProcessContextMenuAction()
		{
			switch(Action)
			{
				case Action.Additem:
					Protocol.Log(
						"QA" + Protocol.QActionID + "|ContextMenuGenericInputMuxTable|ProcessContextMenuAction|Additem",
						LogType.DebugInfo,
						LogLevel.NoLogging);
					AddRow(Protocol, TablePid, Data);
					break;
				case Action.DeleteItem:
					Protocol.Log(
						"QA" +
							Protocol.QActionID +
							"|ContextMenuGenericInputMuxTable|ProcessContextMenuAction|Deleteselecteditem_40_s_41_",
						LogType.DebugInfo,
						LogLevel.NoLogging);
					DeleteRows(Protocol, TablePid, Data);
					break;
				default:
					Protocol.Log(
						"QA" +
							Protocol.QActionID +
							"|ContextMenuGenericInputMuxTable|Process|Unexpected ContextMenu value '" +
							ActionRaw +
							"'",
						LogType.Error,
						LogLevel.NoLogging);
					break;
			}
		}

		private static void AddRow(SLProtocol protocol, int tableId, string[] sa)
		{
			object[] row = new object[] { Guid.NewGuid().ToString(), sa[0], 0.0, };
			protocol.AddRow(tableId, row);
		}

		private static void DeleteRows(SLProtocol protocol, int tableId, string[] ids)
		{
			foreach(string id in ids)
			{
				protocol.DeleteRow(tableId, id);
			}
		}
	}

}

