namespace QAction_4100
{

	using System;
	using Skyline.DataMiner.Scripting;
	using Skyline.DataMiner.Utils.Table.ContextMenu;

	internal enum Action
	{
		Additem = 0,
		DeleteItem = 1,
	}

	internal class ContextMenuGenericOutputMuxTable : ContextMenu<Action>
	{
		public ContextMenuGenericOutputMuxTable(SLProtocol protocol, object contextMenuData, int tablePid) : base(
			protocol,
			contextMenuData,
			tablePid)
		{
		}

		public override void ProcessContextMenuAction()
		{
			switch(Action)
			{
				case Action.Additem:
					Protocol.Log(
						"QA" + Protocol.QActionID + "|ContextMenuGenericOutputMuxTable|ProcessContextMenuAction|Additem",
						LogType.DebugInfo,
						LogLevel.NoLogging);
					AddRow(Protocol, TablePid, Data);
					break;
				case Action.DeleteItem:
					Protocol.Log(
						"QA" +
							Protocol.QActionID +
							"|ContextMenuGenericOutputMuxTable|ProcessContextMenuAction|Deleteselecteditem_40_s_41_",
						LogType.DebugInfo,
						LogLevel.NoLogging);
					DeleteRows(Protocol, TablePid, Data);
					break;
				default:
					Protocol.Log(
						"QA" +
							Protocol.QActionID +
							"|ContextMenuGenericOutputMuxTable|Process|Unexpected ContextMenu value '" +
							ActionRaw +
							"'",
						LogType.Error,
						LogLevel.NoLogging);
					break;
			}
		}

		private static void AddRow(SLProtocol protocol, int tableId, string[] sa)
		{
			object[] row = new object[] { Guid.NewGuid().ToString(), sa[0], string.Empty, string.Empty };
			protocol.AddRow(tableId, row);
		}

		private static void DeleteRows(SLProtocol protocol, int tableId, string[] ids)
		{
			foreach(string id in ids)
			{
				protocol.DeleteRow(tableId, id);
			}
		}
	}

}

			using System;
using Skyline.DataMiner.Scripting;

/// <summary>
/// DataMiner QAction Class: Generic Output Mux Change.
/// </summary>
public static class QAction
{
	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	/// <param name="data">Entered input name.</param>
	public static void Run(SLProtocolExt protocol, object data)
	{
		try
		{
			var input = Convert.ToString(data);
			var inputTable = new QActionTable(protocol, 3000, "GenericInputMuxTable");
			foreach(var key in inputTable.Keys)
			{
				if(Convert.ToString(inputTable[key][1]) == input)
				{
					protocol.SetParameterIndexByKey(4000, protocol.RowKey(), 4, key);
					return;
				}
			}

			protocol.SetParameterIndexByKey(4000, protocol.RowKey(), 4, string.Empty);
		}
		catch(Exception ex)
		{
			protocol.Log(
				$"QA{protocol.QActionID}|{protocol.GetTriggerParameter()}|Run|Exception thrown:{Environment.NewLine}{ex}",
				LogType.Error,
				LogLevel.NoLogging);
		}
	}
}
